import logo from './logo.svg';
import './App.css';

function App() {

  async function test(){
    fetch("/data").then((res) =>
    res.json().then((data) => {
        // Setting a data from api
        setdata({
            name: data.Name,
            age: data.Age,
            date: data.Date,
            programming: data.programming,
        });
    })
);  }

  return (
    <div className="App">
      <button onClick={() => test()}>Click Me</button>
    </div>
  );
}

export default App;
